ing Code &lt;/h2&gt;\n        &lt;pre&gt;\n###################################################################################################\n# Copyright (c) 2020-2022 Centre national de la recherche scientifique (CNRS)\n# Copyright (c) 2020-2022 Commissariat a l'\u00e9nergie atomique et aux \u00e9nergies alternatives (CEA)\n# Copyright (c) 2020-2022 Institut national de recherche en informatique et en automatique (Inria)\n# Copyright (c) 2020-2022 Universit\u00e9 Paris-Saclay\n# Copyright (c) 2020-2022 Universit\u00e9 de Versailles Saint-Quentin-en-Yvelines\n#\n# SPDX-License-Identifier: MIT\n#\n###################################################################################################\n\nfrom dask_interface import Deisa\n# from deisa import Deisa\nfrom dask.distributed import performance_report, wait\nimport os\nimport time\nimport numpy as np\n\nos.environ[\"DASK_DISTRIBUTED__COMM__UCX__INFINIBAND\"] = \"True\"\n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize Deisa\nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\narrays.validate_contract()\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    results = []\n    for i in range(25):\n        \n        cpt = np.sum(gt[i])\n\n        s = client.persist(cpt, release=True)\n\n        results.append(client.compute(s))\n\n    del gt\n\n# Write the results\nwith open(\"results.log\", \"a\") as f:\n    result = [cpt.result() for cpt in results]\n    f.write(str(result))\n\nprint(\"{:&lt;21}\".format(\"EST_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1067","type":"Quad"},{"attributes":{},"id":"1447","type":"CategoricalTickFormatter"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_interval":1800000.0,"min_interval":1000.0,"num_minor_ticks":0},"id":"1551","type":"AdaptiveTicker"},{"attributes":{"axis":{"id":"1012"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1015","type":"Grid"},{"attributes":{},"id":"1561","type":"YearsTicker"},{"attributes":{},"id":"1004","type":"DataRange1d"},{"attributes":{"axis":{"id":"1197"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"1199","type":"Grid"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1459","type":"BoxAnnotation"},{"attributes":{"axis":{"id":"1382"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1385","type":"Grid"},{"attributes":{},"id":"1198","type":"CategoricalTicker"},{"attributes":{"below":[{"id":"1048"}],"center":[{"id":"1051"},{"id":"1055"}],"left":[{"id":"1052"}],"renderers":[{"id":"1070"}],"sizing_mode":"stretch_both","title":{"id":"1417"},"toolbar":{"id":"1061"},"x_range":{"id":"1040"},"x_scale":{"id":"1044"},"y_range":{"id":"1042"},"y_scale":{"id":"1046"}},"id":"1039","subtype":"Figure","type":"Plot"},{"attributes":{"data":{"cpu":["min: 2.0%","max: 99.8%","mean: 22.7%"],"memory":["min: 118.90 MiB","max: 184.67 MiB","mean: 131.14 MiB"],"x":[5,5,5],"y":[70,55,40]},"sel
